function onClickSelected(e,n){e.onclick=n}function onClick(e,n){document.getElementById(e).onclick=n}var IdManager={edit:function(e,n){document.getElementById(""+e).id=n},delete:function(e){document.getElementById(""+e).id=""},switch:function(e,n){var t=document.getElementById(e),c=document.getElementById(n);t.id=""+n,c.id=""+e}};function Insert(e,n){document.getElementById(""+e).innerHTML=n}function Render(e,n){document.getElementById(""+e).innerHTML+=n}function CLASSselector(e){return document.getElementsByClassName(e)}function IDselector(e){return document.getElementById(e)}var doc=document;